Diamond in the Rough


Author : A.A. King

Published October 13th 2013 by A.A.King



Cheyenne Wingate has lived her life without a father. When she is notified by a sexy detective that her father has been murdered, she thrust into a life of wealth and danger. After an attempt on her life, Detective Brian Russell moves in to protect her until the case is solved. They fall in love but Cheyenne does not know if she will live long enough to explore her feelings for the irresistible detective 


